Что мы подразумеваем под обслуживанием организаций?

Под обслуживанием мы подразумеваем обеспечение бесперебойной работы всей компьютерной техники которой владеет фирма. Приведем выражение одного китайского императора: "Я плачу лекарю деньги не за то, что он меня лечит, а за то, что я не болею".
Например: Некая организация имеет 9 компьютеров с 8-ми часовым рабочим днем. Ориентировочная цена составит 500 за 1 единицу компьютерной техники в месяц.
9 * 500 = 4500 руб./месяц.

