- Установка, наладка, обслуживание, ремонт Вашего парка компьютеров и оргтехники;
- Установка и настройка программного обеспечения;
- Антивирусные решения, а также устранение потенциальных дыр в корпоративной безопасности;
- Своевременная оптимизация и модернизация оборудования;
- Консультации ваших сотрудников связанных с пользованием ПК;
- Настройка системы резервирования данных;
- контроль доступа пользователей в Интернет (оптимизация расхода трафика);
- Время прибытия специалиста 2 часа.

При возникновении проблем с компьютером у Вас, прибытие специалиста в
