'age-of-porno.ru' => 'Если задать вопрос мужчине по поводу того, возбуждает его порно или нет, чаще всего, он ответит «да». Ответ «нет», наверное, будет неправдой. К слову, порно возбуждающе действует и на многих женщин. И все-таки большинство поклонников «секса в картинках», будь то <a href="http://age-of-porno.ru">порно видео</a> или порно фото, можно увидеть в числе мужчин. Ведь они любят глазами, и вид обнаженного женского тела, а уж тем более откровенных постельных сцен, вряд ли оставит равнодушным представителя сильного пола. Исходя из этого, глупо отрицать безусловное влияние порно на мужчин, и, особенно, на их физиологию. Это влияние, безусловно, распространяется и на психику. Так как главной движущей силой в желаниях и стремлениях человека выступает его либидо. Оценить как же на самом деле, хорошо или плохо порно воздействует на психику мужчины довольно непросто. Специалисты утверждают, что возможен позитивный терапевтический эффект при лечении импотенции от просмотра порно видео. Тем не менее, они же станут вам говорить, что от порно видео повысится может не только потенция, но еще и уровень агрессивности. То есть можно утверждать, что с одной стороны «секс в картинках» помогает получить не только физиологическую разрядку, но и в то же время психологическую, что благоприятствует здоровому нормальному существованию индивида. Обыватели могут протестовать или оправдывать порно в зависимости от личных убеждений. Их отношение к вопросу, скорее всего, станет моделировать отношение к сексу как таковому. Выносимый приговор будет, помимо всего иного, основываться и на половой жизни личности в целом - на ее модели и реальной интенсивности. Ну и, без сомнений, есть те, кто выступят против уравниловки и потребуют разделять понятия «эротика» и «порно». И при этом мысли каждого человека, к какой бы группе он не относился, будут по-своему справедливыми.',
