'j5b.ru' => 'Попрощавшись с погибшими товарищами, друзья-шахтеры возвращаются к своим проблемам. У Серёги жена мало того, что отказывает в постели, так еще и держит на коротком поводке как "дармоеда". Анатолий Иваныч, или просто Дед, мыкается с больной женой, которой он не в состоянии купить необходимые лекарства. Самый молодой из них, Андрюха души не чает в своей девушке Анжеле, помышляющей о карьере модели, в связи с чем он мучается вырисовывающейся перспективой расставания.
Не находя другого выхода, как взорвать себя в забое ради компенсации, Дед, при попустительстве Андрюхи, подбивает на это Сергея. Отложив "час Х" ради футбольного матча, многодетный Сергей Николаевич узнает о еще одной напасти, связанной с его дочерью, которая не только учится, но и "работает" в городе. Тем временем в тот же город срывается Анжела на конкурс красоты, а к троице примыкает еще один "смертник", страдающий от одиночества, инженер Ефим Ильич. Его ответственный подход к делу увеличивает шансы на "успех" мероприятия, но, к тому моменту, когда их все-таки станет четверо и фитиль будет зажжен, быстро дело не закончится. <a href="http://j5b.ru/boeviki/10159-poslednij-zaboj-2006-dvdrip.html">Последний забой (2006) DVDRip</a>',
