'star--travel.ru' => 'Пыльный мавританский пост исчез из вида двадцать минут назад. Старый «Мерседес» мчится по черной пустой дороге, старательно объезжая наползшие на асфальт кучи песка. Пустыня справа, пустыня слева. К чахлым приграничным кустам жмутся чахлые приграничные верблюды. Ничего такого, что свидетельствовало бы о пересечении маври-танско-малийской границы, границы арабской и Черной <a href="http://star--travel.ru/mali/5-puteshestvie-po-zapadnoj-afrike-na-poputnyx.html">Африки</a>. Впереди на высоком шесте бьется малийский флаг: зеленая полоса, желтая полоса, красная полоса. В нескольких шагах от символа государственности — будка пограничного контроля и первая вялая попытка обмана. Сытый офицер в толстых погонах, тянущих вниз тонкую рубашку, утирает пот со лба и лениво гоняет по комнате мух. Визы в паспорте ему явно недостаточно, он хочет, чтобы въезжающий уплатил несуществующую таксу за пересечение границы - пять тысяч малий-ских франков. Это примерно 12 долларов. Через распахнутое окно видны сонные пограничники. Офицер долго рассказывает о якобы новых правилах въезда в страну, но стоит только показать, что не веришь ни единому его слову, как на его лице появляется добродушная улыбка. С глухим деревянным звуком в паспорт опускается печать. «Добро пожаловать <a href="http://star--travel.ru/mali/5-puteshestvie-po-zapadnoj-afrike-na-poputnyx.html">в Мали</a>. Берегите себя, у нас в стране полно жуликов. Не то что у вас, в Европе», - произносит офицер на прощание.',
